const footer = () => {
    return(
        <div className='max-w-auto mx-auto py-16 px-4 text-gray-500'>
            <>
                <h1 className="w-full text-3xl font-bold m-4 ">WARIO</h1>
                <p className="text-4xl md:text-5xl lg:text-6xl font-bold md:py-6 ">text text text text text text text text text text text text text text text text text text text text text text text text</p>
            </>
        </div>
    )
}

export default footer
